import React from 'react';
import './regSong.css';

export default function RegSong(){
    let trNumber = 0;
    const titleName = "노래 등록하기";
    const htmlTitle = document.querySelector("title");
    htmlTitle.innerHTML= titleName;

    const submitSongFrm = (e) =>{
        e.preventDefault(); //submit의 Action 방지
        
    }

    const addSongInfo = () =>{
        if(trNumber === 0){
            // trNumber = 
            const songList_tbody = document.getElementById('songList_tbody');
            let url = makeTr("text", "유튜브 주소", "youtubeUrl", "youtubeUrl");
            let answer = makeTr("text", "정답", "answer", "answer");
            let hint = makeTr("text", "힌트", "hint", "hint");
            
             /*songList_tbody.append('
           <tr id="songInfoTr'+trNumber+'">
                <td><input type="text" placeholder="유튜브 주소" name="youtubeUrl" class="youtubeUrl"></td> 
                <td><input type="text" placeholder="정답" name="answer" class="answer"> </td> 
                <td><input type="text" placeholder="힌트" name="hint" class="hint"></td>
                <td><button class="remove_btn" type="button" onclick="removeTr('+trNumber+')">X</button></td>
            </tr>');
           */
           songList_tbody.appendChild(tr);
        }
    }

    const makeTd = (input_type, input_placeholder, input_name, input_class) =>{
        let td = document.createElement('td');
        let input = document.createElement('input');
        input.setAttribute('type', input_type);
        input.setAttribute('placeholder', input_placeholder);
        input.setAttribute('name', input_name);
        input.setAttribute('class', input_class);
        td.appendChild(input);
        return td;

    }

    const removeTr = (removeTrNum) =>{
        console.log(removeTrNum);
    }

    return(
        <>
        <section>
            <h1>노래 리스트 만들기</h1>
            <form onSubmit={submitSongFrm}>
            <div className='tbl-header'>
                <table cellSpacing="0" border="0">
                <thead>
                    <tr>
                    <th>제목</th>
                    <th>비밀번호</th>
                    <th>대표 이미지</th>
                    </tr>
                </thead>
                </table>
            </div>
            <div className="tbl-content">
                <table cellSpacing='0' border='0'>
                <tbody>
                    <tr>
                        <td><input type="text" placeholder="제목" name="title" id="title" defaultValue=""/></td>
                        <td><input type="password" placeholder="비밀번호" name="password" id="password"/> </td>
                        <td>이미지 : <input type="file" name="songImg" defaultValue=""/></td>
                    </tr>
                </tbody>
                </table>
            </div>
                <div className="tbl-header">
                <table cellPadding={0} cellSpacing={0} border={0}>
                <thead>
                    <tr>
                    <th>유튜브 주소</th>
                    <th>정답 </th>
                    <th>힌트</th>
                    <th><button type="button" id="add_songList_btn" onClick={addSongInfo}>노래 목록 추가</button></th>
                    </tr>
                </thead>
                </table>
            </div>
            <div className="tbl-content">
                <table cellSpacing="0" border="0">
                <tbody id="songList_tbody">
                        <tr id="songInfoTr1">
                            <td><input type="text" placeholder="유튜브 주소" name="youtubeUrl" className="youtubeUrl"/></td>
                            <td><input type="text" placeholder="정답" name="answer" className="answer"/> </td>
                            <td><input type="text" placeholder="힌트" name="hint" className="hint"/></td>
                            <td><button className="remove_btn" type="button" onClick={removeTr(1)}>X</button></td>
                            <td><input type="hidden" id="trNumber" value={1}/></td>
                        </tr>                        
                </tbody>
                </table>
            </div>
                <button className="submit_btn" onClick={submitSongFrm}>등록</button>
            </form>
        </section>
        </>
    );
}
